		private void button2_Click(object sender, EventArgs e)
        {
			if (!File.Exists("ipdb.txt"))
			{
				using (StreamWriter sw = File.CreateText("ipdb.txt"))
				{
					sw.Write("");
				}
			}
			turnindex = 0;
			String strtotal = usa + "," + france + "," + netherland;
			ipl = strtotal.Split(',').ToList<String>();
			ip_next();
		}
		private void ip_next()
		{
			tempholder = ipl[turnindex];
			String url = tempholder;
			turnindex++;
			if (turnindex >= ipl.Count() - 1)
			{
				MessageBox.Show("ipip finished...");
			}
			else
			{
				LoadURL(url);
				afterDelayCmd = "ip_read";
				delay.Interval = 6000 * 1;
				delay.Enabled = true;
			}
		}
		private async System.Threading.Tasks.Task ip_read()
		{
			String script = "";
			script += "function readrowip()";
			script += "{";
			script += "var tabs = document.querySelectorAll('.nav-pills .nav-link');";
			script += "var outp='';";
			script += "for(var i=0;i<=tabs.length-1;i++){";
			script += "var tbl = document.querySelectorAll(tabs[i].getAttribute('href') + ' a');";
			script += "for(var j=0;j<=tbl.length-1;j++){";
			script += "outp+=tbl[j].innerText+',';";
			script += "}";
			script += "}";
			script += "return outp;";
			script += "}";
			script += "readrowip();";

			var task = CurBrowser.EvaluateScriptAsync(script);

			await task.ContinueWith(t =>
			{
				if (!t.IsFaulted)
				{
					var response = t.Result;

					if (response.Success && response.Result != null)
					{
						using (StreamWriter sw = File.AppendText("ipdb.txt"))
						{
							sw.WriteLine(response.Result.ToString());
						}
						
					}
				}
			});

		}

		private void delay_Tick(object sender, EventArgs e)
        {
                delay.Enabled = false;
                switch (afterDelayCmd)
                {
                  case "ip_read":
                    ip_read();
                    afterDelayCmd = "ip_next";
                    delay.Interval = 6000 * 1;
                    delay.Enabled = true;
                    break;
                  case "ip_next":
                    ip_next();
                    break;
                }
        }
